import React from "react"

export default function Table({ tableItems }) {

    return (
        <>
            <h2>TH elements define table headers</h2>

            <table style="width:100%">
                {tableItems.map((item, index) => {
                    return (
                        <tr key={index}>
                            <th>{item.topic}</th>
                            <td>{item.status}</td>
                        </tr>
                    )
                })}
            </table>
        </>
    )
}
